var title_f4_15_4340="Fibroid embolization PI";
var content_f4_15_4340=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F86790&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F86790&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 572px\">",
"   <div class=\"ttl\">",
"    Uterine artery embolization",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 552px; height: 464px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     During a uterine artery embolization, a doctor inserts a thin tube called a \"catheter\" into the &ldquo;femoral artery&rdquo; at the top of 1 leg. Then he or she advances the tube until the tip of the tube reaches a smaller artery on the other side of the body, called the &ldquo;uterine artery,&rdquo; which carries blood to the uterus (on left). Next the doctor injects a special dye that can be seen on X-rays. The dye allows the doctor to see which arteries bring blood to the fibroid. Next, the doctor injects tiny plastic beads into those arteries to block the flow of blood (see panel on right). This cuts off the blood supply to the fibroid, which causes the fibroid to shrink.",
"    </p>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
